import {Text, StyleSheet, View, FlatList} from 'react-native'

export default function ReportOverview({route, navigation}){
    const data = route.params
    return(
        <View style={styles.container}>
            <Text style={styles.bigBoldText}>{data.timeSpanName}</Text>
            <View >
                <FlatList
                data={data.rawData}
                renderItem={({item}) => (
                    <Text>{item.date}</Text>
                )}
                styles={styles.flatlistView}
                />
            </View>

        </View>

    );
}


const styles = StyleSheet.create({
    flatlistView: {
        backgroundColor: 'blue',
        marginTop: 15,

    },
    bigBoldText: {
        fontSize: 40,
        fontWeight: 'bold',
    },
    normalText: {
        fontSize: 20
    },
    container:{
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: 'pink'
    }
});
